    'sexualwarningbody.SexualWarning_02_Body': {value: '<p><strong>B\u1EB1ng c\xE1ch nh\u1EAFp chu\u1ED9t v\xE0o "T\xF4i ch\u1EA5p nh\u1EADn c\xE1c \u0110i\u1EC1u kho\u1EA3n v\xE0 \u0110i\u1EC1u ki\u1EC7n v\xE0 t\xF4i mu\u1ED1n v\xE0o m\u1EE5c L\xE0m quen k\u1EBFt b\u1EA1n", t\xF4i cam \u0111oan:</strong></p><ul><li>T\xF4i \u0111\xE3 \u0111\u1EE7 18 tu\u1ED5i.</li><li>T\xF4i hi\u1EC3u r\u1EB1ng m\u1EE5c<strong>L\xE0m Quen K\u1EBFt B\u1EA1n </strong> c\xF3 th\u1EC3 ch\u1EE9a n\u1ED9i dung li\xEAn quan tr\u1EF1c ti\u1EBFp \u0111\u1EBFn t\xECnh d\u1EE5c. </li><li>T\xF4i \u0111\u1ED3ng \xFD kh\xF4ng t\u1EA3i l\xEAn nh\u1EEFng h\xECnh \u1EA3nh khi\xEAu d\xE2m, h\xECnh \u1EA3nh ho\u1EB7c h\xECnh minh h\u1ECDa mi\xEAu t\u1EA3 ng\u01B0\u1EDDi kh\xE1c m\xE0 ch\u01B0a \u0111\u01B0\u1EE3c ch\xEDnh ng\u01B0\u1EDDi \u0111\xF3 cho ph\xE9p, h\xECnh c\u1EE7a ng\u01B0\u1EDDi d\u01B0\u1EDBi 18 tu\u1ED5i v\xE0 \u0111\u1EB7c bi\u1EC7t l\xE0 h\xECnh tr\u1EBB em. </li><li>T\xF4i s\u1EBD t\xF4n tr\u1ECDng lu\u1EADt b\u1EA3n quy\u1EC1n v\u1EC1 h\xECnh \u1EA3nh.</li><li>T\xF4i kh\xF4ng \u0111\u01B0a rao v\u1EB7t k\xEDch d\u1EE5c \u0111\u1EC3 ki\u1EC3m ti\u1EC1n ho\u1EB7c \u0111\u01B0\u1EE3c tr\u1EA3 c\xF4ng b\u1EB1ng h\xECnh th\u1EE9c n\xE0o \u0111\xF3.</li><li>T\xF4i \u0111\u1ED3ng \xFD \u0111\xE1nh d\u1EA5u "b\u1ECB c\u1EA5m" l\xEAn m\u1EABu tin n\xE0o t\xF4i th\u1EA5y kh\xF4ng h\u1EE3p ph\xE1p ho\u1EB7c vi ph\u1EA1m <a href="%s" onclick="window.open(this.href); return false;"><strong>\u0110i\u1EC1u kho\u1EA3n s\u1EED d\u1EE5ng OLX</strong></a> v\xE0 t\xF4i \u0111\u1ED3ng \xFD th\xF4ng b\xE1o v\u1EDBi c\xE1c c\u01A1 quan ch\u1EE9c n\u0103ng v\u1EC1 nh\u1EEFng tr\u01B0\u1EDDng h\u1EE3p l\u1EA1m d\u1EE5ng tr\u1EBB v\u1ECB th\xE0nh ni\xEAn \u0111\xE1ng ng\u1EDD.</li><li>T\xF4i hi\u1EC3u l\xE0 OLX kh\xF4ng ch\u1ECBu tr\xE1ch nhi\u1EC7m v\u1EC1 vi\u1EC7c s\u1EED d\u1EE5ng sai tr\xE1i hay v\u1EC1 nh\u1EEFng d\u1ECBch v\u1EE5 c\u1EE7a n\xF3. Vi ph\u1EA1m \u0110i\u1EC1u kho\u1EA3n s\u1EED d\u1EE5ng c\xF3 th\u1EC3 \u0111\u1EBFn vi\u1EC7c b\u1ECB x\xF3a rao v\u1EB7t \u0111\u0103ng t\u1EA3i hay x\xF3a t\xE0i kho\u1EA3n c\u1EE7a b\u1EA1n ngay l\u1EADp t\u1EE9c v\xE0 ch\u1ECBu s\u1EF1 tr\u1EEBng ph\u1EA1t c\u1EE7a c\xE1c c\u01A1 quan ch\u1EE9c n\u0103ng</li></ul>', index: 1220},
