    'cookieshelpbody.DeletingCookiesMessage': {value: 'H\u1EA7u h\u1EBFt cookies l\xE0 cookies theo phi\xEAn l\xE0m vi\u1EC7c, s\u1EBD t\u1EF1 \u0111\u1ED9ng \u0111\u01B0\u1EE3c xo\xE1 kh\u1ECFi \u1ED5 c\u1EE9ng c\u1EE7a b\u1EA1n khi b\u1EA1n k\u1EBFt th\xFAc phi\xEAn l\xE0m vi\u1EC7c (ngh\u0129a l\xE0 khi b\u1EA1n tho\xE1t hay \u0111\xF3ng tr\xECnh duy\u1EC7t web c\u1EE7a b\u1EA1n). M\u1ED9t v\xE0i cookies cho ph\xE9p c\xE1c trang Web nh\u1EADn ra b\u1EA1n khi b\u1EA1n tr\u1EDF l\u1EA1i. N\u1EBFu kh\xF4ng c\xF3 t\u1EC7p cookie, nh\u1EEFng trang Web m\xE0 b\u1EA1n th\u01B0\u1EDDng xuy\xEAn gh\xE9 th\u0103m nh\u01B0 OLX s\u1EBD xem b\u1EA1n nh\u01B0 m\u1ED9t ng\u01B0\u1EDDi d\xF9ng m\u1EDBi m\u1ED7i l\u1EA7n b\u1EA1n tr\u1EDF l\u1EA1i. B\u1EA1n ch\u1EC9 n\xEAn xo\xE1 cookies n\u1EBFu b\u1EA1n nh\u1EADn \u0111\u01B0\u1EE3c tin nh\u1EAFn n\xF3i r\u1EB1ng tr\xECnh duy\u1EC7t c\u1EE7a b\u1EA1n kh\xF4ng ch\u1EA5p nh\u1EADn cookies.', index: 1261},
