    'cookieshelpbody.InternetExplorerStep2': {value: 'Nh\u1EAFp chu\u1ED9t v\xE0o tab <b>Privacy</b>.', index: 1282},
    'cookieshelpbody.InternetExplorerStep3': {value: 'Thi\u1EBFt l\u1EADp m\u1EB7c \u0111\u1ECBnh l\xE0 trung dung, cho ph\xE9p b\u1EA1n ch\u1EA5p nh\u1EADn cookies. \u0110\u1EC3 thay \u0111\u1ED5i thi\u1EBFt l\u1EADp n\xE0y, di chuy\u1EC3n thanh tr\u01B0\u1EE3t \u0111\u1EC3 quy\u1EBFt \u0111\u1ECBnh m\u1EE9c thi\u1EBFt l\u1EADp m\xE0 b\u1EA1n mu\u1ED1n. N\u1EBFu thi\u1EBFt l\u1EADp c\u1EE7a b\u1EA1n l\xE0 Custom, nh\u1EAFp chu\u1ED9t v\xE0o n\xFAt <b>Advanced</b> v\xE0 ch\u1ECDn <b>Accept Cookies</b>.', index: 1283},
    'cookieshelpbody.InternetExplorerTitle': {value: 'Ch\u1EA5p nh\u1EADn cookies \u1EDF Internet Explorer 6.0', index: 1284},
    'cookieshelpbody.Introduction': {value: 'Cookies l\xE0 nh\u1EEFng file nh\u1ECF \u0111\u01B0\u1EE3c \u0111\u1EB7t tr\xEAn \u1ED5 c\u1EE9ng m\xE1y t\xEDnh c\u1EE7a b\u1EA1n \u0111\u1EC3 h\u1ED7 tr\u1EE3 ch\xFAng t\xF4i cung c\u1EA5p d\u1ECBch v\u1EE5. Cookies l\xE0 nh\u1EEFng file nh\u1ECF m\xE0 OLX v\xE0 c\xE1c trang Web kh\xE1c l\u01B0u tr\u1EEF tr\xEAn m\xE1y t\xEDnh c\u1EE7a b\u1EA1n, cho ph\xE9p c\xE1c trang \u0111\xF3 "ghi nh\u1EDB" s\u1EDF th\xEDch c\u1EE7a b\u1EA1n v\xE0  \xEDt y\xEAu c\u1EA7u b\u1EA1n nh\u1EADp m\u1EADt kh\u1EA9u h\u01A1n. Ch\u1EE9c n\u0103ng \u0111\u0103ng nh\u1EADp c\u1EE7a OLX l\xE0m vi\u1EC7c b\u1EB1ng c\xE1ch s\u1EED d\u1EE5ng cookies.', index: 1285},
    'cookieshelpbody.ManagingCookies': {value: 'Ph\u01B0\u01A1ng th\u1EE9c qu\u1EA3n l\xFD cookies mang \u0111\u1EB7c tr\u01B0ng c\u1EE7a m\u1ED7i tr\xECnh duy\u1EC7t Web. Nh\u1EEFng ch\u1EC9 d\u1EABn d\u01B0\u1EDBi \u0111\xE2y l\xE0 d\xE0nh cho nh\u1EEFng tr\xECnh duy\u1EC7t Web m\xE0 OLX gi\u1EDBi thi\u1EC7u.  \u0110\u1EC3 t\xECm hi\u1EC3u v\u1EC1 c\xE1c h\u01B0\u1EDBng d\u1EABn qu\u1EA3n l\xFD cookies \u1EDF c\xE1c tr\xECnh duy\u1EC7t v\xE0 d\u1ECBch v\u1EE5 tr\u1EF1c tuy\u1EBFn kh\xE1c (Netscape, AOL, Opera), xem t\u1EA1i ph\u1EA7n Help c\u1EE7a tr\xECnh duy\u1EC7t Web c\u1EE7a b\u1EA1n. ', index: 1286},
