    'terms.ViolationTermsLiquidatedDamages_content': {value: 'Please report any violations of the Terms, by flagging the posting(s) for review using the <<CONTACTLINK>>Contact Us<</CONTACTLINK>> link at the bottom of the OLX home page, or <<CONTACTLINK_LEGAL>>contact OLX regarding legal issues<</CONTACTLINK_LEGAL>>. Our failure to act with respect to a breach by you or others does not waive our right to act with respect to subsequent or similar breaches. <br />You understand and agree that, because damages are often difficult to quantify, if actual damages cannot be reasonably calculated then you will be liable to pay OLX liquidated damages as follows:', index: 4924},
    'terms.ViolationTermsLiquidatedDamages_content_list': {value: '<<OL_LIST_STYLE_TYPE_LOWER_ALPHA>><li>If you post a message that (1) impersonates any person or entity; (2) falsely states or otherwise misrepresents your affiliation with a person or entity; or (3) that includes personal or identifying information about another person without that person\'s explicit consent, you agree that OLX in its sole discretion may disclose identifying information about you to the victim, and that should OLX bring a claim against you in court, that you will pay OLX one thousand dollars ($1,000) for each such message.</li><li>If OLX establishes limits on the frequency with which you may access the Service, or terminates your access to or use of the Service, you agree to pay OLX one hundred dollars ($100) for each message posted in excess of such limits or for each day on which you access OLX in excess of such limits, whichever is higher.</li><li> If you send unsolicited email advertisements to OLX email addresses or through OLX computer systems, you agree to pay OLX twenty five dollars ($25) for each such email.</li><li> If you post messages in violation of these Terms, other than as described above, you agree to pay OLX one hundred dollars ($100) for each such message. In its sole discretion, OLX may elect to issue a warning before assessing damages.</li><</OL_LIST_STYLE_TYPE_LOWER_ALPHA>>Otherwise, you agree to pay OLX\'s actual damages, to the extent such actual damages can be reasonably calculated.', index: 4925},
    'terms.ViolationTermsLiquidatedDamages_title': {value: 'VIOLATION OF TERMS AND LIQUIDATED DAMAGES', index: 4926},
    'terms.WeAreNotResponsibleForTranslationErrors': {value: 'Ch\xFAng t\xF4i kh\xF4ng ch\u1ECBu tr\xE1ch nhi\u1EC7m v\u1EC1 l\u1ED7i d\u1ECBch thu\u1EADt.', index: 4927},
    'about.': {value: 'Attribute_FL_2_860_37243', index: 4928},
    'about.12345678': {value: '<B> Enter the actual price for your property. </B>', index: 4929},
    'about.About': {value: '<table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0"> <tr><td height="30" colspan="2" bgcolor="#FFB18C" class="titOLX"><span class="titolx1">About OLX</td></tr></table><table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0">  <tr valign="top">  <th align="left" class="MainBodyBkgrdBrdr" scope="col"> <table width="900" border="0" cellspacing="0" cellpadding="0" align="left">    <tr>     <th align="left" valign="top" class="MainBodyBkgrd"><table width="900" border="0" cellspacing="5" cellpadding="5" align="left">  <tr>    <td>     <table width="100%" border="0" cellspacing="0" cellpadding="0" align="left" class="cuadro">        <tr> <td><table width="100%" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0"> <tr><td align="left" class="aviso2"><br />OLX means free local classifieds on a global level. OLX allows you to meet others, express yourself, trade products, find jobs, apartments, and much more! <br/ ><br/ >We built OLX to improve on traditional classified sites, which are functional but missing key features to really deliver a proper public service to communities everywhere.<br /></td></tr> <tr><td align="left" class="aviso2">On OLX you can:<br /><br /><ul><li>Easily design rich HTML listings</li><li>Control your selling, buying, and community activity in My OLX</li><li>Send or accept PayPal payments</li><li>Be assured of a spam-free experience</li><li>Promote your listings on other websites, like MySpace, Xanga, and Blogspot</li><li>Discuss listings with other interested users</li><li>Enjoy a website that has world-class speed</li><li>Search for items near you, wherever you live</li><li>Access our site from your mobile phone</li><li>View our site in your local language</li></ul>OLX has a presence on six continents. The company was founded in March 2006 and is privately held.<br/ ><br/ ></b></td></tr></table></td>        </tr>      </table>    </td>  </tr></table><br /><br />     </th>    </tr>         </table>  </th><!-- END MAIN PAGE COLUMN --> </tr></table>', index: 4930},
    'about.AboutBrand': {value: 'V\u1EC1 OLX', index: 4931},
    'about.AboutText1': {value: 'OLX l\xE0 n\u1EC1n t\u1EA3ng rao v\u1EB7t h\xE0ng \u0111\u1EA7u th\u1EBF gi\u1EDBi t\u1EADp trung v\xE0o c\xE1c th\u1ECB tr\u01B0\u1EDDng \u0111ang n\u1ED5i, c\u1EA3 di \u0111\u1ED9ng v\xE0 tr\u1EF1c tuy\u1EBFnCEO Europe', index: 4932},
    'about.AboutText2': {value: 'OLX ho\u1EA1t \u0111\u1ED9ng tr\xEAn to\xE0n c\u1EA7u v\xE0 c\xF3 m\u1EB7t tr\xEAn 40 qu\u1ED1c gia', index: 4933},
    'about.about_Body': {value: '<p>OLX l\xE0 th\u1EBF h\u1EC7 sau c\u1EE7a rao v\u1EB7t tr\u1EF1c tuy\u1EBFn mi\u1EC5n ph\xED.<br /><br />OLX cung c\u1EA5p gi\u1EA3i ph\xE1p \u0111\u01A1n gi\u1EA3n cho c\xE1c v\u1EA5n \u0111\u1EC1 ph\u1EE9c t\u1EA1p li\xEAn quan \u0111\u1EBFn vi\u1EC7c b\xE1n, mua, giao th\u01B0\u01A1ng, b\xE0n lu\u1EADn, t\u1ED5 ch\u1EE9c, g\u1EB7p g\u1EE1 nh\u1EEFng ng\u01B0\u1EDDi quanh b\u1EA1n, b\u1EA5t k\u1EC3 b\u1EA1n s\u1ED1ng \u1EDF \u0111\xE2u.<br /><br />T\u1EA1i OLX b\u1EA1n c\xF3 th\u1EC3:<br /><ul><li>thi\u1EBFt k\u1EBF nh\u1EEFng qu\u1EA3ng c\xE1o nhi\u1EC1u m\xE0u s\u1EAFc v\u1EDBi h\xECnh \u1EA3nh.</li><li>Ki\u1EC3m so\xE1t vi\u1EC7c b\xE1n, mua, v\xE0 ho\u1EA1t \u0111\u1ED9ng c\u1ED9ng \u0111\u1ED3ng c\u1EE7a b\u1EA1n tr\xEAn "OLX c\u1EE7a t\xF4i"</li><li>Hi\u1EC3n th\u1ECB c\xE1c rao v\u1EB7t c\u1EE7a b\u1EA1n tr\xEAn ti\u1EC3u s\u1EED m\u1EA1ng x\xE3 h\u1ED9i c\u1EE7a b\u1EA1n  (Facebook, Myspace, ...)</li><li>Truy c\u1EADp trang n\xE0y t\u1EEB \u0111i\u1EC7n tho\u1EA1i di \u0111\u1ED9ng c\u1EE7a b\u1EA1n</li><li>Xem OLX b\u1EB1ng ng\xF4n ng\u1EEF \u0111\u1ECBa ph\u01B0\u01A1ng c\u1EE7a b\u1EA1n</li></ul><br />OLX \u0111\u01B0\u1EE3c s\u1EED d\u1EE5ng tr\xEAn <<QTY_COUNTRIES>> qu\u1ED1c gia v\xE0 v\u1EDBi <<QTY_LANGUAGES>> ng\xF4n ng\u1EEF. C\xF4ng ty \u0111\u01B0\u1EE3c th\xE0nh l\u1EADp v\xE0o th\xE1ng 03 n\u0103m 2006 v\xE0 thu\u1ED9c s\u1EDF h\u1EEFu c\xE1 nh\xE2n.</p>', index: 4934},
