    'about.BuyersForAllYouSell': {value: 'Tr\xEAn OLX, c\xF3 ng\u01B0\u1EDDi mua cho h\u1EA7u h\u1EBFt m\u1ECDi th\u1EE9 m\xE0 b\u1EA1n c\xF3 \u0111\u1EC3 b\xE1n.</br>H\xE0ng tri\u1EC7u ng\u01B0\u1EDDi \u0111\xE3 b\xE1n \u0111\u01B0\u1EE3c h\xE0ng tr\xEAn OLX. B\u1EA1n c\u0169ng c\xF3 th\u1EC3.', index: 4939},
