    'about.FastAndEasy': {value: 'OLX l\xE0 c\xE1ch nhanh ch\xF3ng v\xE0 d\u1EC5 d\xE0ng \u0111\u1EC3 b\xE1n m\xF3n \u0111\u1ED3 c\u1EE7a b\u1EA1n. <strong>Mi\u1EC5n ph\xED</strong>.', index: 4952},
    'about.GeneralCounsel': {value: 'C\u1ED1 v\u1EA5n chung', index: 4953},
    'about.History': {value: 'L\u1ECBch s\u1EED', index: 4954},
    'about.HistoryText1': {value: 'OLX \u0111\u01B0\u1EE3c \u0111\u1ED3ng s\xE1ng l\u1EADp v\xE0o n\u0103m 2006 b\u1EDFi c\xE1c nh\xE0 kinh doanh internet l\xE0 Fabrice Grinda v\xE0 Alec Oxenford t\u1EA1i \xC1c-hen-ti-na. Ng\xE0y nay, n\xF3 l\xE0 m\u1ED9t trong nh\u1EEFng n\u1EC1n t\u1EA3ng rao v\u1EB7t tr\u1EF1c tuy\u1EBFn mi\u1EC5n ph\xED d\u1EABn \u0111\u1EA7u th\u1EBF gi\u1EDBi, c\xF3 m\u1EB7t t\u1EA1i h\u01A1n 40 qu\u1ED1c gia v\xE0 b\u1EB1ng h\u01A1n 50 ng\xF4n ng\u1EEF.', index: 4955},
    'about.HistoryText2': {value: 'M\u1ED7i ng\xE0y, h\xE0ng tri\u1EC7u ng\u01B0\u1EDDi tr\xEAn to\xE0n c\u1EA7u s\u1EED d\u1EE5ng OLX \u0111\u1EC3 mua v\xE0 b\xE1n h\xE0ng ho\xE1 v\xE0 xe c\u1ED9, t\xECm vi\u1EC7c l\xE0m hay thu\xEA nh\xE0. N\u1EC1n t\u1EA3ng OLX c\xF3 h\u01A1n 200 tri\u1EC7u ng\u01B0\u1EDDi d\xF9ng kh\xE1c nhau m\u1ED7i th\xE1ng, t\u1EA1o ra h\u01A1n 11 t\u1EC9 l\u01B0\u1EE3t gh\xE9 th\u0103m h\xE0ng th\xE1ng hay 360 tri\u1EC7u l\u01B0\u1EE3t xem m\u1ED7i ng\xE0y. T\u1EADp \u0111o\xE0n n\xE0y c\xF3 1200 nh\xE2n vi\xEAn \u1EDF kh\u1EAFp c\xE1c v\u0103n ph\xF2ng t\u1EA1i Buenos Aires, Cape Town, Delhi, Sao Paulo, Rio de Janeiro, Lisbon v\xE0 New York.', index: 4956},
    'about.HistoryText3': {value: 'Ban \u0111\u1EA7u Naspers \u0111\xE3 mua l\u1EA1i 67,8% s\u1EDF h\u1EEFu c\u1ED5 ph\u1EA7n t\u1EA1i OLX.inc v\xE0o th\xE1ng 8/2010, sau \u0111\xF3 t\u0103ng l\xEAn 95%. L\xE0 m\u1ED9t ph\u1EA7n trong s\xE1ng ki\u1EBFn bi\u1EBFn \u0111\u1ED5i OLX th\xE0nh nh\xE3n hi\u1EC7u l\u1EDBn nh\u1EA5t th\u1EBF gi\u1EDBi v\u1EC1 giao d\u1ECBch t\u1EEB ng\u01B0\u1EDDi ti\xEAu d\xF9ng \u0111\u1EBFn ng\u01B0\u1EDDi ti\xEAu d\xF9ng (C2C), g\u1EA7n \u0111\xE2y Naspers \u0111\xE3 t\u1ED5ng h\u1EE3p c\xE1c d\u1ECBch v\u1EE5 rao v\u1EB7t tr\u1EF1c tuy\u1EBFn c\u1EE7a m\xECnh t\u1EA1i Phi-l\xEDp-pin, Th\xE1i Lan, Ba Lan, Hung-ga-ri, Ru-ma-ni v\xE0 In-\u0111\xF4-n\xEA-xia v\xE0 \u0111\u1ED5i t\xEAn ch\xFAng th\xE0nh OLX.', index: 4957},
