    'about.PostingBalloonTip_description_30_301': {value: 'Nh\u1EADp chi ti\u1EBFt t\xE0i s\u1EA3n c\u1EE7a b\u1EA1n v\xED d\u1EE5 nh\u01B0 \u0111i\u1EC1u h\xF2a kh\xF4ng kh\xED, th\xF9ng \u0111\u1EF1ng, ph\xEDa tr\u01B0\u1EDBc ho\u1EB7c ph\xEDa sau, gia \u0111\xECnh, ti\u1EC1n tr\u1EE3 c\u1EA5p.', index: 4979},
    'about.PostingBalloonTip_Email_0_0': {value: 'H\xE3y \u0111i\u1EC1n t\xEAn th\u1EADt \u0111\u1EC3 ng\u01B0\u1EDDi mua bi\u1EBFt g\u1ECDi b\u1EA1n th\u1EBF n\xE0o khi h\u1ECD g\u1ECDi \u0111i\u1EC7n li\xEAn h\u1EC7 v\u1EDBi b\u1EA1n. B\u1EA1n kh\xF4ng c\u1EA7n thi\u1EBFt ph\u1EA3i \u0111i\u1EC1n \u0111\u1EA7y \u0111\u1EE7 h\u1ECD t\xEAn.', index: 4980},
    'about.Presence': {value: 'C\xF3 m\u1EB7t', index: 4981},
    'about.SellingIsEasy': {value: 'B\xE1n h\xE0ng th\u1EADt d\u1EC5 d\xE0ng', index: 4982},
    'about.SellThings': {value: 'H\xE3y b\xE1n chi\u1EBFc \u0111i\u1EC7n tho\u1EA1i c\u0169 n\u1EB1m trong h\u1ED9c b\xE0n c\u1EE7a b\u1EA1n.</br>H\xE3y b\xE1n chi\u1EBFc ghi-ta m\xE0 b\u1EA1n ch\u01B0a bao gi\u1EDD ch\u01A1i.</br>H\xE3y b\xE1n chi\u1EBFc xe \u0111\u1EA9y tr\u1EBB em m\xE0 v\u1EABn c\u1EA5t \u1EDF trong t\u1EE7 c\u1EE7a ch\u1ECB g\xE1i b\u1EA1n.</br>H\xE3y b\xE1n chi\u1EBFc xe m\xE1y c\u1EE7a b\u1EA1n v\xE0 n\xE2ng c\u1EA5p l\xEAn m\u1ED9t chi\u1EBFc m\u1EDBi h\u01A1n.</br>H\xE3y b\xE1n nh\u1EEFng \u0111\xF4i gi\xE0y m\xE0 b\u1EA1n \u0111i kh\xF4ng v\u1EEBa.</br>H\xE3y b\xE1n chi\u1EBFc xe h\u01A1i c\u1EE7a b\u1EA1n.</br>', index: 4983},
    'about.Spam': {value: '', index: 4984},
    'about.Stats': {value: 'Th\u1ED1ng k\xEA', index: 4985},
    'about.StrategyOperations': {value: 'Chi\u1EBFn l\u01B0\u1EE3c v\xE0 Ho\u1EA1t \u0111\u1ED9ng', index: 4986},
    'about.TableFreeText': {value: 'Ch\u1EEF t\u1EF1 do', index: 4987},
    'about.Test': {value: 'Testteteteetetetetet', index: 4988},
    'about.WeekendTakesLonger': {value: 'Nh\u1EEFng rao v\u1EB7t \u0111\u0103ng v\xE0o ban \u0111\xEAm ho\u1EB7c cu\u1ED1i tu\u1EA7n c\xF3 th\u1EC3 m\u1EA5t nhi\u1EC1u th\u1EDDi gian h\u01A1n \u0111\u1EC3 hi\u1EC3n th\u1ECB. Vui l\xF2ng kh\xF4ng \u0111\u0103ng l\u1EB7p rao v\u1EB7t c\u1EE7a b\u1EA1n.', index: 4989},
    'about.WithinTime': {value: '<li>Trong v\xF2ng v\xE0i gi\xE2y b\u1EA1n c\xF3 th\u1EC3 li\u1EC7t k\xEA ra m\u1ED9t m\xF3n h\xE0ng \u0111\u1EC3 b\xE1n (h\xE3y s\u1EED d\u1EE5ng \u0111i\u1EC7n tho\u1EA1i c\u1EE7a m\xECnh!)</li><li>Trong v\xF2ng v\xE0i ph\xFAt, m\xF3n \u0111\u1ED3 c\u1EE7a b\u1EA1n s\u1EBD xu\u1EA5t hi\u1EC7n tr\xEAn OLX</li><li>Trong v\xF2ng v\xE0i gi\u1EDD b\u1EA1n s\u1EBD nh\u1EADn \u0111\u01B0\u1EE3c tin t\u1EEB nh\u1EEFng ng\u01B0\u1EDDi mu\u1ED1n mua h\xE0ng</li><li>Trong v\xF2ng v\xE0i ng\xE0y b\u1EA1n s\u1EBD g\u1EB7p nh\u1EEFng ng\u01B0\u1EDDi mua n\xE0y v\xE0 b\xE1n m\xF3n \u0111\u1ED3 c\u1EE7a b\u1EA1n l\u1EA5y ti\u1EC1n m\u1EB7t</li><li>Trong v\xF2ng v\xE0i tu\u1EA7n b\u1EA1n s\u1EBD khi\u1EBFn cu\u1ED9c s\u1ED1ng c\u1EE7a m\xECnh \u0111\u01A1n gi\u1EA3n v\xE0 \u0111\u01B0\u1EE3c c\u1EA3i thi\u1EC7n</li>', index: 4990},
