    'mail_crm.CRM1_Bullet_1': {value: '<<LI_MARGIN_5PX>><strong>\u0110\u1EEANG BAO GI\u1EDC b\xE1n th\u1EE9 g\xEC cho ng\u01B0\u1EDDi n\xE0o s\u1ED1ng ngo\xE0i qu\u1ED1c gia m\xE0 b\u1EA1n c\u01B0 tr\xFA. </strong><br />M\u1ED9t kho\u1EA3n thanh to\xE1n \u0111\u1EBFn t\u1EEB m\u1ED9t ng\xE2n h\xE0ng n\u01B0\u1EDBc ngo\xE0i c\xF3 th\u1EC3 m\u1EA5t 3 \u0111\u1EBFn 4 tu\u1EA7n m\u1EDBi \u0111\u1EBFn \u0111\u01B0\u1EE3c ng\xE2n h\xE0ng c\u1EE7a b\u1EA1n. Trong khi ch\u1EDD \u0111\u1EE3i, kho\u1EA3n ti\u1EC1n \u0111\u01B0\u1EE3c ghi c\xF3 v\xE0o t\xE0i kho\u1EA3n c\u1EE7a b\u1EA1n, nh\u01B0ng n\u1EBFu kho\u1EA3n thanh to\xE1n l\xE0 gi\u1EA3,  kho\u1EA3n ti\u1EC1n n\xE0y s\u1EBD \u0111\u01B0\u1EE3c ghi n\u1EE3 v\xE0o t\xE0i kho\u1EA3n c\u1EE7a b\u1EA1n.<</LI_MARGIN_5PX>>', index: 4994},
    'mail_crm.CRM1_Bullet_2': {value: '<<LI_MARGIN_5PX>> <strong> Kh\xF4ng bao gi\u1EDD ch\u1EA5p nh\u1EADn s\xE9c n\u01B0\u1EDBc ngo\xE0i. </strong><br /> H\u1EA7u h\u1EBFt c\xE1c k\u1EBB l\u1EEBa \u0111\u1EA3o \u0111\u1EC1u g\u1EEDi s\xE9c gi\u1EA3. <</LI_MARGIN_5PX>>', index: 4995},
    'mail_crm.CRM1_Bullet_3': {value: '<<LI_MARGIN_5PX>><strong>\u0110\u1EEANG BAO GI\u1EDC ch\u1EA5p nh\u1EADn m\u1ED9t kho\u1EA3n thanh to\xE1n bao g\u1ED3m m\u1ED9t kho\u1EA3n ti\u1EC1n l\u1EDBn h\u01A1n gi\xE1 tr\u1ECB c\u1EE7a m\xF3n h\xE0ng c\u1EE7a b\u1EA1n.</strong><br />B\u1EA1n \u0110\u1EEANG BAO GI\u1EDC g\u1EEDi ti\u1EC1n \u0111\u1EC3 ho\xE0n l\u1EA1i m\u1ED9t kho\u1EA3n thanh to\xE1n v\u01B0\u1EE3t m\u1EE9c, b\u1EA5t k\u1EC3 l\xFD do l\xE0 g\xEC (qu\xE0 t\u1EB7ng, ph\xED chuy\u1EC3n h\xE0ng, ph\xED h\u1EA3i quan, ph\xED trung gian, v.v.)<</LI_MARGIN_5PX>>', index: 4996},
    'mail_crm.CRM1_Bullet_4': {value: '<<LI_MARGIN_5PX>><strong>N\u1EBFu ng\u01B0\u1EDDi mua t\u1EF1 gi\u1EDBi thi\u1EC7u l\xE0 ng\u01B0\u1EDDi trung gian (lu\u1EADn s\u01B0, ng\u01B0\u1EDDi t\u01B0 v\u1EA5n, v.v.) \u0111\u1EA1i di\u1EC7n cho m\u1ED9t kh\xE1ch h\xE0ng \u1EDF n\u01B0\u1EDBc ngo\xE0i, \u0110\u1EEANG TI\u1EBEN H\xC0NH cu\u1ED9c mua b\xE1n.</strong><</LI_MARGIN_5PX>>', index: 4997},
    'mail_crm.CRM1_Bullet_5': {value: '<<LI_MARGIN_5PX>><strong>OLX kh\xF4ng bao gi\u1EDD tham gia v\xE0o th\u01B0\u01A1ng th\u1EA3o ho\u1EB7c giao d\u1ECBch.</strong><br />Ch\xFAng t\xF4i kh\xF4ng h\u1ED7 tr\u1EE3 vi\u1EC7c thanh to\xE1n ho\u1EB7c chuy\u1EC3n h\xE0ng; ch\xFAng t\xF4i kh\xF4ng b\u1EA3o \u0111\u1EA3m l\xE0 b\u1EA1n s\u1EBD h\xE0i l\xF2ng v\u1EC1 s\u1EA3n ph\u1EA9m; v\xE0 ch\xFAng t\xF4i kh\xF4ng cung \u1EE9ng b\u1EA5t k\u1EF3 d\u1ECBch v\u1EE5 t\xE0i ch\xEDnh n\xE0o, hay d\u1ECBch v\u1EE5 b\u1EA3o v\u1EC7 ng\u01B0\u1EDDi b\xE1n ho\u1EB7c ng\u01B0\u1EDDi mua.<</LI_MARGIN_5PX>>', index: 4998},
    'mail_crm.CRM1_Bullet_6': {value: '<<LI_MARGIN_5PX>><strong>>  Kh\xF4ng ti\u1EBFt l\u1ED9 th\xF4ng tin t\xE0i ch\xEDnh </strong>><br /> Nh\u01B0 s\u1ED1 t\xE0i kho\u1EA3n ng\xE2n h\xE0ng, s\u1ED1 an sinh x\xE3 h\u1ED9i v.v... <</LI_MARGIN_5PX>>', index: 4999},
    'mail_crm.CRM1_Bullet_7': {value: '<<LI_MARGIN_5PX>><strong> H\xE3y th\u1EADn tr\u1ECDng khi b\u1EA1n c\u1EA7n chuy\u1EC3n h\xE0ng ho\u1EB7c s\u1EED d\u1EE5ng d\u1ECBch v\u1EE5 qua trung gian. </strong><</LI_MARGIN_5PX>>', index: 5000},
    'mail_crm.CRM1_Bullet_8': {value: '<<LI_MARGIN_5PX>><strong>N\u1EBFu b\u1EA1n nh\u1EADn \u0111\u01B0\u1EE3c m\u1ED9t email n\xF3i r\u1EB1ng b\u1EA1n \u0111\xE3 th\u1EAFng m\u1ED9t gi\u1EA3i th\u01B0\u1EDFng v\xE0 c\u1EA7n ph\u1EA3i tr\u1EA3 ti\u1EC1n v\u1EADn chuy\u1EC3n, h\xE3y \u0111\u1EEBng h\u1ED3i \u0111\xE1p v\xE0 li\xEAn h\u1EC7 v\u1EDBi </strong> <<CONTACTLINK>>Nh\xF3m D\u1ECBch V\u1EE5 Kh\xE1ch H\xE0ng<</CONTACTLINK>> c\u1EE7a ch\xFAng t\xF4i<</LI_MARGIN_5PX>>', index: 5001},
    'mail_crm.CRM_FirstPost_02_Body': {value: '<p><strong>Ch\xFAc m\u1EEBng b\u1EA1n \u0111\u0103ng tin rao v\u1EB7t \u0111\u1EA7u ti\xEAn \u1EDF OLX<<ItemTitle>></strong></p><p>Ch\xFAng t\xF4i \u0111\u1EC1 ngh\u1ECB b\u1EA1n l\u01B0u email n\xE0y, b\u1EA1n s\u1EBD t\xECm \u0111\u01B0\u1EE3c th\xF4ng tin h\u1EEFu \xEDch cho c\xE1c giao d\u1ECBch trong t\u01B0\u01A1ng lai li\xEAn quan \u0111\u1EBFn rao v\u1EB7t v\xE0/ho\u1EB7c c\xE1c trang web \u0111\u1EA5u gi\xE1.</p><p>Ch\xFAng t\xF4i khuy\xEAn b\u1EA1n n\xEAn giao d\u1ECBch t\u1EA1i \u0111\u1ECBa ph\u01B0\u01A1ng, theo c\xE1ch n\xE0y c\u1EA3 2 b\xEAn \u0111\u1EC1u c\xF3 th\u1EC3 tr\u1EF1c ti\u1EBFp g\u1EB7p m\u1EB7t tr\u01B0\u1EDBc khi ti\u1EBFn h\xE0nh. </p><p>Tuy nhi\xEAn, n\u1EBFu kh\xE1ch mua/kh\xE1ch h\xE0ng ti\u1EC1m n\u0103ng kh\xF4ng \u1EDF trong khu v\u1EF1c c\u1EE7a b\u1EA1n, \u0111\xE2y l\xE0 m\u1ED9t v\xE0i l\u1EDDi khuy\xEAn m\xE0 b\u1EA1n n\xEAn ghi nh\u1EDB:</p><ol style="border-top:1px solid #DCDCDC;border-bottom:1px solid #DCDCDC;background-color:#E9E9E9; padding-right:5px;"><li style="margin: 5px 0"><span style="color: #ff6e33;">\u0110\u1EEANG BAO GI\u1EDC b\xE1n th\u1EE9 g\xEC cho ng\u01B0\u1EDDi n\xE0o s\u1ED1ng ngo\xE0i qu\u1ED1c gia m\xE0 b\u1EA1n c\u01B0 tr\xFA. </span><br />M\u1ED9t kho\u1EA3n thanh to\xE1n \u0111\u1EBFn t\u1EEB m\u1ED9t ng\xE2n h\xE0ng n\u01B0\u1EDBc ngo\xE0i c\xF3 th\u1EC3 m\u1EA5t 3 \u0111\u1EBFn 4 tu\u1EA7n m\u1EDBi \u0111\u1EBFn \u0111\u01B0\u1EE3c ng\xE2n h\xE0ng c\u1EE7a b\u1EA1n. Trong khi ch\u1EDD \u0111\u1EE3i, kho\u1EA3n ti\u1EC1n \u0111\u01B0\u1EE3c ghi c\xF3 v\xE0o t\xE0i kho\u1EA3n c\u1EE7a b\u1EA1n, nh\u01B0ng n\u1EBFu kho\u1EA3n thanh to\xE1n l\xE0 gi\u1EA3,  kho\u1EA3n ti\u1EC1n n\xE0y s\u1EBD \u0111\u01B0\u1EE3c ghi n\u1EE3 v\xE0o t\xE0i kho\u1EA3n c\u1EE7a b\u1EA1n.</li><li style="margin: 5px 0"><span style="color: #ff6e33;">\u0110\u1EEANG BAO GI\u1EDC ch\u1EA5p nh\u1EADn m\u1ED9t kho\u1EA3n thanh to\xE1n bao g\u1ED3m m\u1ED9t kho\u1EA3n ti\u1EC1n l\u1EDBn h\u01A1n gi\xE1 tr\u1ECB c\u1EE7a m\xF3n h\xE0ng c\u1EE7a b\u1EA1n.</span><br />B\u1EA1n \u0110\u1EEANG BAO GI\u1EDC g\u1EEDi ti\u1EC1n \u0111\u1EC3 ho\xE0n l\u1EA1i m\u1ED9t kho\u1EA3n thanh to\xE1n v\u01B0\u1EE3t m\u1EE9c, b\u1EA5t k\u1EC3 l\xFD do l\xE0 g\xEC (qu\xE0 t\u1EB7ng, ph\xED chuy\u1EC3n h\xE0ng, ph\xED h\u1EA3i quan, ph\xED trung gian, v.v.)</li><li style="margin: 5px 0"><span style="color: #ff6e33;">N\u1EBFu ng\u01B0\u1EDDi mua t\u1EF1 gi\u1EDBi thi\u1EC7u l\xE0 ng\u01B0\u1EDDi trung gian (lu\u1EADn s\u01B0, ng\u01B0\u1EDDi t\u01B0 v\u1EA5n, v.v.) \u0111\u1EA1i di\u1EC7n cho m\u1ED9t kh\xE1ch h\xE0ng \u1EDF n\u01B0\u1EDBc ngo\xE0i, \u0110\u1EEANG TI\u1EBEN H\xC0NH cu\u1ED9c mua b\xE1n.</span></li><li style="margin: 5px 0"><span style="color: #ff6e33;">OLX kh\xF4ng bao gi\u1EDD tham gia v\xE0o th\u01B0\u01A1ng th\u1EA3o ho\u1EB7c giao d\u1ECBch.</span><br />Ch\xFAng t\xF4i kh\xF4ng h\u1ED7 tr\u1EE3 vi\u1EC7c thanh to\xE1n ho\u1EB7c chuy\u1EC3n h\xE0ng; ch\xFAng t\xF4i kh\xF4ng b\u1EA3o \u0111\u1EA3m l\xE0 b\u1EA1n s\u1EBD h\xE0i l\xF2ng v\u1EC1 s\u1EA3n ph\u1EA9m; v\xE0 ch\xFAng t\xF4i kh\xF4ng cung \u1EE9ng b\u1EA5t k\u1EF3 d\u1ECBch v\u1EE5 t\xE0i ch\xEDnh n\xE0o, hay d\u1ECBch v\u1EE5 b\u1EA3o v\u1EC7 ng\u01B0\u1EDDi b\xE1n ho\u1EB7c ng\u01B0\u1EDDi mua.</li></ol><<AntiFraudForum>> <<AntiFraudHelp>><<ANONYMOUSUSER>><p>Ch\xFAng t\xF4i ch\xFAc b\u1EA1n giao d\u1ECBch th\xE0nh c\xF4ng tr\xEAn OLX!<br /><<FooterMail_01_Support>><br /></p><<REGISTEREDUSER>>', index: 5002},
    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>M\u1EB8O H\u1EEEU \xCDCH:</strong></p><p>B\u1EA1n kh\xF4ng c\u1EA7n ph\u1EA3i \u0111\u0103ng k\xFD m\u1EDBi s\u1EED d\u1EE5ng \u0111\u01B0\u1EE3c OLX, nh\u01B0ng ch\xFAng t\xF4i khuy\xEAn b\u1EA1n n\xEAn \u0111\u0103ng k\xFD:<br /><ul><li>B\u1EA1n s\u1EBD qu\u1EA3n l\xFD rao v\u1EB7t c\u1EE7a b\u1EA1n d\u1EC5 d\xE0ng h\u01A1n.</li><li>B\u1EA1n c\xF3 th\u1EC3 truy c\u1EADp \u0110\u1EA5u gi\xE1 v\xE0 Mua ngay.</li><li>\u0110\u0103ng k\xFD Nhanh ch\xF3ng v\xE0 Mi\u1EC5n ph\xED.</li></ul><a href="<<RegisterLink>>">\u0110\u0103ng k\xFD ngay b\xE2y gi\u1EDD!</a></p>', index: 5003},
