    'bidbuynow.BuyNowConfirmation': {value: 'X\xE1c nh\u1EADn Mua Ngay', index: 9790},
    'bidbuynow.BuyNowInstructions': {value: 'B\u1EA1n \u0111\xE3 ch\u1ECDn "Mua Ngay" \u0111\u1EC3 mua m\xF3n h\xE0ng \u1EDF tr\xEAn. N\u1EBFu b\u1EA1n mu\u1ED1n ti\u1EBFp t\u1EE5c v\xE0 mua m\xF3n h\xE0ng n\xE0y ngay l\u1EADp t\u1EE9c v\u1EDBi m\u1EE9c gi\xE1 n\xEAu tr\xEAn, xin nh\u1EAFp chu\u1ED9t v\xE0o n\xFAt "Mua ngay". Phi\xEAn \u0111\u1EA5u gi\xE1 s\u1EBD \u0111\u01B0\u1EE3c \u0111\xF3ng l\u1EA1i, cho ph\xE9p b\u1EA1n v\xE0 ng\u01B0\u1EDDi b\xE1n ho\xE0n t\u1EA5t giao d\u1ECBch.', index: 9791},
