    'bidbuynow.Instructions': {value: 'Nh\xE2n danh b\u1EA1n, ph\u1EA7n m\u1EC1m s\u1EBD \u0111\u1EB7t gi\xE1 t\u0103ng d\u1EA7n cho \u0111\u1EBFn m\u1EE9c gi\xE1 th\u1EA7u cao nh\u1EA5t m\xE0 b\u1EA1n nh\u1EADp v\xE0o d\u01B0\u1EDBi \u0111\xE2y, v\u1ED1n \u0111\u01B0\u1EE3c gi\u1EEF b\xED m\u1EADt \u0111\u1ED1i v\u1EDBi nh\u1EEFng ng\u01B0\u1EDDi d\xF9ng kh\xE1c. Ch\u1EC9 c\u1EA7n nh\u1EADp v\xE0o m\u1EE9c gi\xE1 cao nh\u1EA5t m\xE0 b\u1EA1n s\u1EB5n l\xF2ng chi tr\u1EA3 cho m\xF3n h\xE0ng v\xE0 nh\u1EAFp chu\u1ED9t \u0111\u1EC7 tr\xECnh. B\u1EA1n s\u1EBD kh\xF4ng th\u1EC3 thay \u0111\u1ED5i (n\xE2ng) m\u1EE9c gi\xE1 th\u1EA7u trong phi\xEAn \u0111\u1EA5u gi\xE1 n\xE0y cho \u0111\u1EBFn khi c\xF3 nh\xE0 th\u1EA7u kh\xE1c \u0111\u1EB7t gi\xE1 cao h\u01A1n b\u1EA1n. Do \u0111\xF3, xin h\xE3y xem x\xE9t c\u1EA9n th\u1EADn nh\u1EEFng g\xEC b\u1EA1n s\u1EB5n l\xF2ng chi tr\u1EA3 cho m\xF3n h\xE0ng n\xE0y. Ch\xFAc may m\u1EAFn!', index: 9801},
