    'misc.Content_sub2': {value: 'Nh\u1EADp li\u1EC7u delta', index: 10004},
    'misc.Content_text1': {value: 'Ph\u1EA7n nh\u1EADp li\u1EC7u ph\u1EA3i ch\u1EE9a t\u1EEBng rao v\u1EB7t m\xE0 b\u1EA1n mu\u1ED1n \u0111\u0103ng tr\xEAn OLX. C\xE1c rao v\u1EB7t c\xF3 trong ph\u1EA7n nh\u1EADp li\u1EC7u s\u1EBD \u0111\u01B0\u1EE3c \u0111\u0103ng tr\xEAn OLX. B\u1EA5t c\u1EE9 rao v\u1EB7t n\xE0o kh\xF4ng c\xF2n trong ph\u1EA7n nh\u1EADp li\u1EC7u n\u1EEFa s\u1EBD b\u1ECB g\u1EE1 b\u1ECF kh\u1ECFi OLX. Ch\xFAng t\xF4i y\xEAu c\u1EA7u m\u1ED9t \u0111\u01B0\u1EDDng d\u1EABn URL t\u0129nh cho t\xF9y ch\u1ECDn n\xE0y (m\u1ED9t URL kh\xF4ng bao gi\u1EDD thay \u0111\u1ED5i)', index: 10005},
    'misc.Content_text2': {value: 'M\u1ED7i ph\u1EA7n nh\u1EADp li\u1EC7u s\u1EBD ch\u1EE9a nh\u1EEFng rao v\u1EB7t m\u1EDBi m\xE0 b\u1EA1n mu\u1ED1n \u0111\u0103ng, nh\u1EEFng rao v\u1EB7t b\u1EA1n mu\u1ED1n ch\u1EC9nh s\u1EEDa v\xE0 nh\u1EEFng rao v\u1EB7t b\u1EA1n mu\u1ED1n g\u1EE1 b\u1ECF. B\u1EA5t c\u1EE9 rao v\u1EB7t n\xE0o m\xE0 gi\u1EEF nguy\xEAn kh\xF4ng \u0111\u1ED5i th\xEC kh\xF4ng c\u1EA7n ph\u1EA3i \u0111\u01B0a v\xE0o. Ch\xFAng t\xF4i y\xEAu c\u1EA7u m\u1ED9t URL m\xE0 thay \u0111\u1ED5i h\xE0ng ng\xE0y, d\u1EF1a tr\xEAn ng\xE0y th\xE1ng. Ch\xFAng t\xF4i th\u01B0\u1EDDng ch\u1EA5p nh\u1EADn c\xE1c ph\u1EA7n nh\u1EADp li\u1EC7u delta \u0111\u1ED1i v\u1EDBi c\xE1c \u0111\u1ED1i t\xE1c c\xF3 tr\xEAn 100.000 rao v\u1EB7t. N\u1EBFu b\u1EA1n c\xF3 \xEDt h\u01A1n 100.000 rao v\u1EB7t nh\u01B0ng mu\u1ED1n cung c\u1EA5p m\u1ED9t ph\u1EA7n nh\u1EADp li\u1EC7u delta cho ch\xFAng t\xF4i th\xEC tr\u01B0\u1EDBc ti\xEAn h\xE3y li\xEAn l\u1EA1c v\u1EDBi ch\xFAng t\xF4i tr\u01B0\u1EDBc \u0111\u1EC3 xem c\xF3 t\xF9y ch\u1ECDn n\xE0y kh\xF4ng.', index: 10006},
