    'misc.DescMessage': {value: 'C\u1EA7n ph\u1EA3i \u0111\u01B0a v\xE0o m\u1ED9t m\xF4 t\u1EA3 \u0111\u1EA7y \u0111\u1EE7. Trong ph\u1EA7n m\xF4 t\u1EA3 th\xED \u0111i\u1EC3m n\xE0y, ch\xFAng t\xF4i c\xF3 th\u1EC3 b\u1EA3o v\u1EC7 nh\u1EEFng k\xED t\u1EF1 th\xF4ng th\u01B0\u1EDDng ph\xE1 v\u1EE1 m\u1ED9t XML b\u1EB1ng c\xE1ch s\u1EED d\u1EE5ng c\xE1c v\u1ECF b\u1ECDc CDATA xung quanh to\xE0n b\u1ED9 ph\u1EA7n ch\u1EEF.', index: 10032},
