    'misc.DesktopComputer': {value: 'm\xE1y t\xEDnh \u0111\u1EC3 b\xE0n', index: 10040},
    'misc.DidYouKnow_1_BR': {value: 'B\u1EA1n c\xF3 bi\u1EBFt l\xE0 sau khi \u0111\u0103ng rao v\u1EB7t, n\xF3 s\u1EBD kh\xF4ng \u0111\u01B0\u1EE3c hi\u1EC3n th\u1ECB ngay? C\u1EA7n ph\u1EA3i m\u1EA5t t\u1EDBi 6 ti\u1EBFng \u0111\u1EC3 n\xF3 ho\u1EA1t \u0111\u1ED9ng. Nh\u01B0ng \u0111\u1EEBng lo, b\u1EA1n s\u1EBD nh\u1EADn \u0111\u01B0\u1EE3c email th\xF4ng b\xE1o ngay khi n\xF3 \u0111\u01B0\u1EE3c \u0111\u0103ng. Kh\xF4ng \u0111\u0103ng rao v\u1EB7t c\u1EE7a b\u1EA1n hai l\u1EA7n. T\xECm hi\u1EC3u th\xEAm.', index: 10041},
    'misc.DidYouKnow_2_BR': {value: 'B\u1EA1n c\xF3 bi\u1EBFt l\xE0 c\u1EA7n c\xF3 th\u1EDDi h\u1EA1n 48 ti\u1EBFng \u0111\u1EC3 rao v\u1EB7t c\u1EE7a b\u1EA1n \u0111\u01B0\u1EE3c hi\u1EC3n th\u1ECB n\u1ED5i b\u1EADt. Khi n\xF3 \u0111\u01B0\u1EE3c \u0111\u0103ng n\u1ED5i b\u1EADt, n\xF3 s\u1EBD \u0111\u01B0\u1EE3c hi\u1EC3n th\u1ECB xoay v\xF2ng v\u1EDBi c\xE1c rao v\u1EB7t \u0111\u01B0\u1EE3c \u0111\u0103ng kh\xE1c. N\u1EBFu \u0111\xE3 h\u1EBFt th\u1EDDi h\u1EA1n m\xE0 rao v\u1EB7t c\u1EE7a b\u1EA1n kh\xF4ng \u0111\u01B0\u1EE3c \u0111\u0103ng n\u1ED5i b\u1EADt, h\xE3y li\xEAn h\u1EC7 v\u1EDBi ch\xFAng t\xF4i v\xE0 \u0111\xEDnh k\xE8m theo ch\u1EE9ng t\u1EEB thanh to\xE1n \u0111\u1EC3 ch\xFAng t\xF4i c\xF3 th\u1EC3 xem x\xE9t tr\u01B0\u1EDDng h\u1EE3p c\u1EE7a b\u1EA1n.', index: 10042},
    'misc.DidYouKnow_3_BR': {value: 'B\u1EA1n c\xF3 bi\u1EBFt l\xE0 ph\u1EA3i sau 48 ti\u1EBFng th\xEC rao v\u1EB7t c\u1EE7a b\u1EA1n m\u1EDBi \u0111\u01B0\u1EE3c \u0111\u0103ng n\u1ED5i b\u1EADt. Ngay khi n\xF3 \u0111\u01B0\u1EE3c \u0111\u0103ng n\u1ED5i b\u1EADt n\xF3 s\u1EBD \u0111\u01B0\u1EE3c xoay v\xF2ng v\u1EDBi c\xE1c rao v\u1EB7t kh\xE1c trong th\u1EDDi gian \u0111\u01B0\u1EE3c ch\u1ECDn.', index: 10043},
