    'misc.MiscInfo': {value: '<li>Kh\xF4ng \u0111\u01B0\u1EE3c n\xF3i x\u1EA5u, b\xF4i nh\u1ECD th\u01B0\u01A1ng m\u1EA1i, \u0111e d\u1ECDa b\u1EA5t h\u1EE3p ph\xE1p ho\u1EB7c qu\u1EA5y r\u1ED1i b\u1EA5t h\u1EE3p ph\xE1p. H\u01A1n n\u1EEFa kh\xF4ng \u0111\u01B0\u1EE3c gian l\u1EADn, xuy\xEAn t\u1EA1c, g\xE2y hi\u1EC3u l\u1EA7m ho\u1EB7c li\xEAn quan \u0111\u1EBFn vi\u1EC7c b\xE1n b\u1EA5t k\u1EF3 h\xE0ng h\xF3a phi ph\xE1p, \u0103n c\u1EAFp v\xE0 ho\u1EB7c d\u1ECBch v\u1EE5 m\xE0 kh\xF4ng thu\u1ED9c v\u1EC1 b\u1EA1n ho\u1EB7c b\u1EA1n kh\xF4ng c\xF3 quy\u1EC1n.</li><li>Kh\xF4ng ch\u1EE9a b\u1EA5t k\u1EF3 lo\u1EA1i virus, Trojan, s\xE2u hay ch\u01B0\u01A1ng tr\xECnh m\xE1y t\xEDnh kh\xE1c c\xF3 th\u1EC3 g\xE2y t\u1ED5n h\u1EA1i, can thi\u1EC7p g\xE2y b\u1EA5t l\u1EE3i, ng\u0103n ch\u1EB7n l\xE9n l\xFAt hay l\u1EEBa d\u1ED1i chi\u1EBFm \u0111o\u1EA1t b\u1EA5t k\u1EF3 h\u1EC7 th\u1ED1ng, d\u1EEF li\u1EC7u ho\u1EB7c th\xF4ng tin c\xE1 nh\xE2n n\xE0o.</li><li>Kh\xF4ng \u0111\u01B0\u1EE3c ph\xE9p b\xF4i nh\u1ECD b\u1EA5t c\u1EE9 ai ho\u1EB7c c\xF3 th\xF9 h\u1EB1n, x\xFAc ph\u1EA1m, l\u1EDDi n\xF3i vu kh\u1ED1ng nh\u1EB1m v\xE0o c\xE1c c\xE1 nh\xE2n ho\u1EB7c nh\xF3m. B\u1EA1n kh\xF4ng n\xEAn \u1EE7ng h\u1ED9 b\u1EA1o l\u1EF1c \u0111\u1ED1i v\u1EDBi ng\u01B0\u1EDDi d\xF9ng hay c\xE1 nh\xE2n ho\u1EB7c c\xE1c nh\xF3m kh\xE1c.</li>', index: 10293},
