    'misc.ProhibitedPractices': {value: '<li><strong>C\xE1c b\xE0i \u0111\u0103ng rao v\u1EB7t tr\xF9ng l\u1EB7p</strong> - B\u1EA5t k\u1EF3 rao v\u1EB7t \u0111\u01B0\u1EE3c \u0111\u0103ng nhi\u1EC1u h\u01A1n m\u1ED9t l\u1EA7n v\u1EDBi c\xF9ng m\u1ED9t n\u1ED9i dung ho\u1EB7c ti\xEAu \u0111\u1EC1 trong c\xF9ng m\u1ED9t th\xE0nh ph\u1ED1 v\xE0 th\u1EC3 lo\u1EA1i s\u1EBD \u0111\u01B0\u1EE3c coi nh\u01B0 m\u1ED9t tin rao tr\xF9ng l\u1EB7p. Ch\xFAng t\xF4i khuy\xEAn b\u1EA1n ch\u1EC9 n\xEAn g\u1EEDi nhi\u1EC1u rao v\u1EB7t n\u1EBFu b\u1EA1n c\xF3 c\xE1c s\u1EA3n ph\u1EA9m hay d\u1ECBch v\u1EE5 kh\xE1c nhau \u0111\u1EC3 b\xE1n. T\u1EA5t c\u1EA3 rao v\u1EB7t tr\xF9ng l\u1EB7p s\u1EBD b\u1ECB x\xF3a v\xE0 ng\u01B0\u1EDDi \u0111\u0103ng s\u1EBD b\u1ECB ph\u1EA1t n\u1EBFu v\u1EA5n \u0111\u1EC1 v\u1EABn ti\u1EBFp di\u1EC5n.</li><li><strong>\u0110\u0103ng c\xE1c t\xE0i li\u1EC7u cho ng\u01B0\u1EDDi tr\u01B0\u1EDFng th\xE0nh/c\xF3 h\u01B0\u1EDBng t\u1EDBi t\xECnh d\u1EE5c:</strong> Rao v\u1EB7t li\xEAn quan \u0111\u1EBFn c\xE1c m\u1EB7t h\xE0ng bao g\u1ED3m c\xE1c m\u1EB7t h\xE0ng d\xE0nh cho s\u1EED d\u1EE5ng trong ho\u1EA1t \u0111\u1ED9ng t\xECnh d\u1EE5c s\u1EBD kh\xF4ng \u0111\u01B0\u1EE3c ph\xE9p. C\u0169ng xin l\u01B0u \xFD r\u1EB1ng ti\xEAu \u0111\u1EC1 v\u1EDBi ng\xF4n ng\u1EEF  \u0111\u1ED3 h\u1ECDa ng\u01B0\u1EDDi l\u1EDBn l\xE0 kh\xF4ng ph\xF9 h\u1EE3p, kh\xF4ng ph\u1EE5 thu\u1ED9c v\xE0o m\xF3n h\xE0ng ch\u1EE9a trong b\u1EA3n th\xE2n b\xE0i \u0111\u0103ng \u0111\xF3.</li><li>Vi\u1EBFt <strong>c\xE1c Ti\xEAu \u0111\u1EC1 g\xE2y hi\u1EC3u l\u1EA7m</strong></li><li>T\u1EA3i <strong>\u1EA3nh kh\xF4ng ph\xF9 h\u1EE3p/sai</strong> v\u1EDBi rao v\u1EB7t</li><li>\u0110\u0103ng c\xE1c m\u1EB7t h\xE0ng trong <strong>c\xE1c danh m\u1EE5c kh\xF4ng ph\xF9 h\u1EE3p</strong></li><li>N\xEAu sai <strong>\u0111\u1ECBa \u0111i\u1EC3m c\u1EE7a m\xF3n h\xE0ng</strong></li><li>\u0110\u01B0a <strong>gi\xE1 kh\xF4ng th\u1EF1c t\u1EBF</strong></li>', index: 10521},
