    'misc.TipsForBuyers': {value: 'M\u1EB9o d\xE0nh cho ng\u01B0\u1EDDi mua:', index: 10773},
    'misc.TipsForBuyersList': {value: '<li>Mua h\xE0ng t\u1EA1i \u0111\u1ECBa ph\u01B0\u01A1ng c\u1EE7a m\xECnh \u0111\u1EC3 b\u1EA1n c\xF3 th\u1EC3 ki\u1EC3m tra m\xF3n h\xE0ng, g\u1EB7p ng\u01B0\u1EDDi b\xE1n v\xE0 tr\u1EA3 ti\u1EC1n khi b\u1EA1n \u0111\u1EBFn l\u1EA5y \u0111\u1ED3 ho\u1EB7c khi nh\u1EADn \u0111\u01B0\u1EE3c h\xE0ng. H\xE3y nh\u1EDB s\u1EED d\u1EE5ng m\u1ED9t n\u01A1i an to\xE0n \u0111\u1EC3 g\u1EB7p m\u1EB7t. </li><li>C\xE1ch t\u1ED1t nh\u1EA5t \u0111\u1EC3 giao d\u1ECBch l\xE0 trao \u0111\u1ED5i h\xE0ng h\xF3a v\xE0 thanh to\xE1n c\xF9ng m\u1ED9t l\xFAc. </li><li>H\xE3y h\u1ECFi nh\u1EEFng th\xF4ng tin r\xF5 r\xE0ng v\u1EC1 \u0111i\u1EC1u ki\u1EC7n c\u1EE7a h\xE0ng h\xF3a, gi\xE1 c\u1EA3, ph\u01B0\u01A1ng th\u1EE9c thanh to\xE1n v\xE0 giao h\xE0ng.</li><li>Ch\u1EC9 s\u1EED d\u1EE5ng nh\u1EEFng ph\u01B0\u01A1ng th\u1EE9c thanh to\xE1n th\xF4ng d\u1EE5ng m\xE0 b\u1EA1n tin t\u01B0\u1EDFng v\xE0 quen thu\u1ED9c.</li><li>H\u1ECFi ng\u01B0\u1EDDi b\xE1n s\u1ED1 v\u1EADn \u0111\u01A1n n\u1EBFu nh\u01B0 s\u1EA3n ph\u1EA9m \u0111ang \u0111\u01B0\u1EE3c g\u1EEDi \u0111i. </li><li>L\u1EA5y s\u1ED1 \u0111i\u1EC7n tho\u1EA1i c\xF3 th\u1EC3 x\xE1c th\u1EF1c \u0111\u01B0\u1EE3c t\u1EEB ng\u01B0\u1EDDi b\xE1n.</li><li>Trong tr\u01B0\u1EDDng h\u1EE3p l\xE0 h\xE0ng \u0111i\u1EC7n t\u1EED, \xF4 t\xF4 v\xE0 xe m\xE1y/xe \u0111\u1EA1p, b\u1EA1n c\u1EA7n ki\u1EC3m tra ch\u1EE9c n\u0103ng c\u1EE7a s\u1EA3n ph\u1EA9m tr\u01B0\u1EDBc khi mua.</li><li>Ti\u1EBFn h\xE0nh nghi\xEAn c\u1EE9u so s\xE1nh gi\xE1 \u0111\u1ED1i v\u1EDBi s\u1EA3n ph\u1EA9m.</li><li>Kh\xF4ng chia s\u1EBB th\xF4ng tin t\xE0i ch\xEDnh c\u1EE7a m\xECnh. </li><li>Lu\xF4n s\u1EED d\u1EE5ng "G\u1EEDi Email cho ng\u01B0\u1EDDi b\xE1n" \u0111\u1EC3 li\xEAn l\u1EA1c v\u1EDBi ng\u01B0\u1EDDi b\xE0n. \u0110i\u1EC1u n\xE0y s\u1EBD gi\xFAp ch\xFAng t\xF4i th\xF4ng b\xE1o cho b\u1EA1n ngay khi ch\xFAng t\xF4i \u0111\u01B0\u1EE3c bi\u1EBFt v\u1EC1 b\u1EA5t c\u1EE9 h\xE0nh \u0111\u1ED9ng l\u1EEBa \u0111\u1EA3o n\xE0o c\u1EE7a ng\u01B0\u1EDDi b\xE1nr.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'M\u1EB9o d\xE0nh cho ng\u01B0\u1EDDi b\xE1n:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>N\xEAn nh\u1EADn thanh to\xE1n to\xE0n b\u1ED9 v\xE0o l\xFAc giao h\xE0ng. H\xE3y nh\u1EDB s\u1EED d\u1EE5ng m\u1ED9t n\u01A1i an to\xE0n \u0111\u1EC3 g\u1EB7p m\u1EB7t.</li><li>X\xE1c nh\u1EADn v\u0103n b\u1EA3n x\xE1c th\u1EF1c c\u1EE7a ng\u01B0\u1EDDi mua n\u1EBFu c\xF3 \u0111\u1EC1 ngh\u1ECB mua h\xE0ng s\u1ED1 l\u01B0\u1EE3ng l\u1EDBn.</li><li> L\u1EA5y s\u1ED1 \u0111i\u1EC7n tho\u1EA1i c\xF3 th\u1EC3 x\xE1c th\u1EF1c \u0111\u01B0\u1EE3c t\u1EEB ng\u01B0\u1EDDi mua.</li><li>\u0110\u1EA3m b\u1EA3o r\u1EB1ng s\u1EA3n ph\u1EA9m c\u1EE7a m\xECnh \u0111\xE1p \u1EE9ng \u0111\u01B0\u1EE3c c\xE1c t\xEDnh n\u0103ng m\xE0 b\u1EA1n n\xEAu ra trong rao v\u1EB7t \u0111\u1EC3tr\xE1nh hi\u1EC3u l\u1EA7m v\u1EDBi ng\u01B0\u1EDDi mua.</li><li>Kh\xF4ng chia s\u1EBB c\xE1c th\xF4ng tin t\xE0i ch\xEDnh c\u1EE7a m\xECnh ngo\u1EA1i tr\u1EEB c\xE1c th\xF4ng tin c\u1EA7n thi\u1EBFt cho vi\u1EC7c thanh to\xE1n.</li>', index: 10776},
