    'payment.PayUsingStoredDetails': {value: 'Thanh to\xE1n b\u1EB1ng c\xE1c chi ti\u1EBFt \u0111\xE3 l\u01B0u tr\u01B0\u1EDBc \u0111\xF3', index: 11417},
