    'featured_listings.TermsOfService_content': {value: 'C\xE1c \u0111i\u1EC1u kho\u1EA3n d\u1ECBch v\u1EE5 n\xE0y \u0111\u1EC1 c\u1EADp t\u1EDBi vi\u1EC7c s\u1EED d\u1EE5ng Rao V\u1EB7t N\u1ED5i B\u1EADt v\xE0 l\xE0 b\u1ED5 sung cho c\xE1c \u0110i\u1EC1u kho\u1EA3n d\u1ECBch v\u1EE5 chung c\u1EE7a ch\xFAng t\xF4i .<br /><ul><li>L\xE0 b\u1EB1ng ch\u1EE9ng c\u1EE7a vi\u1EC7c thanh to\xE1n cho Rao v\u1EB7t n\u1ED5i b\u1EADt, OLX s\u1EBD ch\u1EC9 ph\xE1t h\xE0nh "X\xE1c nh\u1EADn mua h\xE0ng" m\xE0 b\u1EA1n s\u1EBD th\u1EA5y \u1EDF cu\u1ED1i qu\xE1 tr\xECnh mua h\xE0ng v\xE0 m\u1ED9t email x\xE1c nh\u1EADn.</li><li>N\u1EBFu v\xEC l\xFD do n\xE0o \u0111\xF3, d\xF9 l\xE0 v\u1EC1 k\u1EF9 thu\u1EADt hay v\u1EC1 b\u1EA5t c\u1EE9 l\xFD do n\xE0o m\xE0 rao v\u1EB7t c\u1EE7a b\u1EA1n kh\xF4ng hi\u1EC3n th\u1ECB trong m\u1EE5c "Rao V\u1EB7t N\u1ED5i B\u1EADt" th\xEC ch\xFAng t\xF4i ch\u1EC9 c\xF3 tr\xE1ch nhi\u1EC7m gi\u1EDBi h\u1EA1n l\xE0 \u0111\u0103ng rao v\u1EB7t c\u1EE7a b\u1EA1n v\xE0o v\u1ECB tr\xED ngay khi ch\xFAng t\xF4i c\xF3 th\u1EC3.</li><li><<CLICK_AND_BUY_LINK>><<CLICK_AND_BUY>><</CLICK_AND_BUY_LINK>> cung c\u1EA5p gi\u1EA3i ph\xE1p t\u1EA1o h\xF3a \u0111\u01A1n c\u1EE7a ch\xFAng t\xF4i.</li><li>T\u1EA5t c\u1EA3 d\u1EEF li\u1EC7u thu th\u1EADp \u0111\u01B0\u1EE3c b\u1EB1ng d\u1ECBch v\u1EE5 n\xE0y s\u1EBD \u0111\u01B0\u1EE3c ch\xFAng t\xF4i qu\u1EA3n l\xFD theo ch\xEDnh s\xE1ch b\u1EA3o m\u1EADt c\u1EE7a ch\xFAng t\xF4i.</li><li>C\xE1c rao v\u1EB7t c\xF3 n\u1ED9i dung x\xFAc ph\u1EA1m, khi\xEAu d\xE2m, th\u01B0 r\xE1c, l\u1EEBa \u0111\u1EA3o ti\u1EC1m n\u0103ng ho\u1EB7c x\xE2m ph\u1EA1m b\u1EA3n quy\u1EC1n s\u1EBD kh\xF4ng \u0111\u01B0\u1EE3c hi\u1EC3n th\u1ECB ti\xEAu bi\u1EC3u.</li></ul>', index: 11577},
