    'featured_listings.WhyCantIModifyMyListing': {value: 'T\u1EA1i sao t\xF4i kh\xF4ng th\u1EC3 \u0111i\u1EC1u ch\u1EC9nh rao v\u1EB7t c\u1EE7a t\xF4i?', index: 11596},
    'featured_listings.WhyCantIModifyMyListing_content': {value: '\u0110\u1EC3 gi\xFAp kh\xE1ch gh\xE9 th\u0103m c\xF3 c\u1EA3m nh\u1EADn t\u1ED1t (nh\u1EEFng ng\u01B0\u1EDDi c\xF3 th\u1EC3 \u0111\xE3 \u0111\xE1nh d\u1EA5u trang rao v\u1EB7t c\u1EE7a b\u1EA1n), ch\xFAng t\xF4i kh\xF4ng cho ph\xE9p b\u1EA1n \u0111i\u1EC1u ch\u1EC9nh Rao V\u1EB7t N\u1ED5i B\u1EADt cho t\u1EDBi khi l\u1EF1a ch\u1ECDn Rao V\u1EB7t N\u1ED5i B\u1EADt c\u1EE7a b\u1EA1n h\u1EBFt h\u1EA1n<br /><br />N\u1EBFu b\u1EA1n mu\u1ED1n thay \u0111\u1ED5i qu\u1EA3ng c\xE1o th\xEC b\u1EA1n c\xF3 hai l\u1EF1a ch\u1ECDn:<br /><ul><li>\u0110\u1EE3i cho t\u1EDBi khi l\u1EF1a ch\u1ECDn Rao V\u1EB7t N\u1ED5i B\u1EADt k\u1EBFt th\xFAc, h\xE3y thay \u0111\u1ED5i rao v\u1EB7t v\xE0 l\u1EA1i mua l\u1EF1a ch\u1ECDn Rao V\u1EB7t N\u1ED5i B\u1EADt ho\u1EB7c </li><li>\u0110\u1ED1i v\u1EDBi c\xE1c thay \u0111\u1ED5i h\u1EBFt s\u1EE9c quan tr\u1ECDng<<CONTACTLINK>>li\xEAn h\u1EC7 v\u1EDBi Nh\xF3m d\u1ECBch v\u1EE5 kh\xE1ch h\xE0ng c\u1EE7a ch\xFAng t\xF4i<</CONTACTLINK>>.</li></ul>', index: 11597},
    'featured_listings.YouCanChooseWhereToFeatureYourAd': {value: '- B\u1EA1n c\xF3 th\u1EC3 ch\u1ECDn l\xE0m n\u1ED5i b\u1EADt rao v\u1EB7t c\u1EE7a m\xECnh \u1EDF trang ch\u1EE7 ho\u1EB7c \u1EDF m\u1ED9t danh s\xE1ch c\u1EE5 th\u1EC3 n\xE0o \u0111\xF3 m\xE0 tin rao v\u1EB7t c\u1EE7a b\u1EA1n \u0111\u01B0\u1EE3c \u0111\u0103ng (ho\u1EB7c c\u1EA3 hai!)', index: 11598},
    'featured_listings.YourAdIsCurrentlyFeatured': {value: 'Qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n hi\u1EC7n \u0111ang \u0111\u01B0\u1EE3c \u0111\u0103ng t\u1EA3i \u0111\u1EB7c tr\u01B0ng. B\u1EA1n vui l\xF2ng ch\u1EDD \u0111\u1EBFn khi th\u1EDDi h\u1EA1n \u0111\u1EB7c tr\u01B0ng k\u1EBFt th\xFAc m\u1EDBi \u0111\u1EC1 xu\u1EA5t n\xF3 m\u1ED9t l\u1EA7n n\u1EEFa.', index: 11599},
    'featured_listings.YourAdWillBeFeaturedSoon': {value: 'Qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n s\u1EBD \u0111\u01B0\u1EE3c l\xE0m n\u1ED5i b\u1EADt s\u1EDBm. Ch\xFAng t\xF4i s\u1EBD \u0111\u0103ng qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n sau khi \u0111\u1ED9i ng\u0169 c\u1EE7a ch\xFAng t\xF4i \u0111\xE1nh gi\xE1 n\xF3 trong ng\xE0y l\xE0m vi\u1EC7c ti\u1EBFp theo.', index: 11600},
